import 'aframe';
import { Scene, Entity } from 'aframe-react';
import React from 'react';



 
class VREx extends React.Component {



  render () {
    return (
      <div className="VREx">
      <a-scene artoolkit={{sourceType: 'webcam', trackingMethod: 'best'}}>
 
     
          <a-entity minecraft minecraft-head-anim="yes" minecraft-body-anim="hiwave" material='opacity: 0.5' />
         
  </a-scene>
  </div>
    );
  }
}


export default VREx;
